@JsonMap({})
class ProjectEdit(BaseModel):
    """ProjectEdit

    :param auto_tt: List of language codes to automatically transcribe the audio of all uploaded videos., defaults to None
    :type auto_tt: List[TtAutoLang], optional
    :param description: Description of the project., defaults to None
    :type description: str, optional
    :param published: Public videos can only be viewed when the project is published. Otherwise you'll need a private link or a password., defaults to None
    :type published: bool, optional
    :param timezone: Timezone of the project., defaults to None
    :type timezone: Timezone, optional
    :param title: Title of the project., defaults to None
    :type title: str, optional
    """

    def __init__(
        self,
        auto_tt: List[TtAutoLang] = None,
        description: str = None,
        published: bool = None,
        timezone: Timezone = None,
        title: str = None,
    ):
        """ProjectEdit

        :param auto_tt: List of language codes to automatically transcribe the audio of all uploaded videos., defaults to None
        :type auto_tt: List[TtAutoLang], optional
        :param description: Description of the project., defaults to None
        :type description: str, optional
        :param published: Public videos can only be viewed when the project is published. Otherwise you'll need a private link or a password., defaults to None
        :type published: bool, optional
        :param timezone: Timezone of the project., defaults to None
        :type timezone: Timezone, optional
        :param title: Title of the project., defaults to None
        :type title: str, optional
        """
        if auto_tt is not None:
            self.auto_tt = self._define_list(auto_tt, TtAutoLang)
        if description is not None:
            self.description = self._define_str(
                "description", description, min_length=1, max_length=128
            )
        if published is not None:
            self.published = published
        if timezone is not None:
            self.timezone = self._enum_matching(timezone, Timezone.list(), "timezone")
        if title is not None:
            self.title = self._define_str("title", title, min_length=1, max_length=64)
